import React from 'react';
import { Row, Col, Card, Image } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import carpeta from '../../resource/carpeta.png';

const ShowExpedients = props => {
	return (
		<Row>
            {props.expedientes.map( expediente => (
                <Col key={expediente.id} md={props.vista ? 12 : 3}>
                    <Card>
                    	<Card.Body>
                            <Image src={carpeta} width={props.vista ? 40 : 80} 
                            className={props.vista ? 'mr-2' : 'd-block mx-auto'} />
	                        <Link to="/detail/123">
	                            <b>{expediente.nombre}</b>
	                        </Link>
                        </Card.Body>
                    </Card>
                </Col>
            ))}
    	</Row>
	);
}

export default ShowExpedients;
